/* eslint-disable import/no-anonymous-default-export */


export default(props) => {
    return (


<div className="card">
<div className="card-body">
  <h5 className="card-title">Obrigado Pela Preferencia!!!!</h5>
  <p className="card-text">
    “Onde meus talentos e minhas paixões encontram as necessidades do
    mundo, lá está o meu caminho, o meu lugar.” (Aristóteles)
  </p>
  <img src={props.Foto} class="card-img-bottom" alt="..." />
</div>
</div>
    );
}
